import { ComponentHeaderAuth } from "@components";
import { ComponentSocialMedia } from "src/Components/SocialMedia";
import { ComponentFaceBookButton, ComponentGoogleButton, ComponentLineButton } from "@components";
export const PageSignUpEmail = () => {
    const socials = [<ComponentFaceBookButton/>, <ComponentGoogleButton/>, ComponentLineButton];

    return (
        <>
            <ComponentHeaderAuth />

            <ComponentSocialMedia socials={socials} />
        </>
    );
};
